import React from 'react';
import { Data } from './Components/Data';

function App() {


    return (
        <>
          <div className='bg-gray-400'>
            <h1 className='text-center text-black text-[50px] '>CARTS</h1>
                {
                    Data.map((item,index)=>{                        
                     <div className='w-[250px] h-auto flex justify-around flex-wrap'>
                        {item.price}
                            {item.name}
                        </div>
                    })
                }


          </div>
        </>
    );
}

export default App;
